import "./IncomeList.css";
import TotalList from "./TotalList";
const IncomeList = (props) => {
  return (
    <div>
      <h2>Income</h2>
      <div className="income-list__data">
        <ul>
          <li>
            <p className="income-list__description">{props.data.desc}</p>
            <p className="income-list__amount">{props.data.desc}</p>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default IncomeList;
